import React from 'react';
import { useSelector } from 'react-redux';
import BookList from './BookList';
import AddBookPopup from './AddBookPopup';
import EditBookPopup from './EditBookPopup';

const Bookstore = () => {
  const isAddBookPopupOpen = useSelector(state => state.isAddBookPopupOpen);
  const isEditBookPopupOpen = useSelector(state => state.isEditBookPopupOpen);

  return (
    <div>
      <BookList />
      {isAddBookPopupOpen && <AddBookPopup />}
      {isEditBookPopupOpen && <EditBookPopup />}
    </div>
  );
};

export default Bookstore;
